import React from "react";
import "./Buttons";
import Buttons from "./Buttons";
function Card({ imageSrc }) {
  return (
    <div className="card">
      <img className="image" src={imageSrc} alt="blaa" />
      <h2>Hello</h2>
      <p>Bla</p>
      <Buttons />
    </div>
  );
}

export default Card;
